import React, { useState } from 'react';
import DiaryEditor from './components/DiaryEditor';
import DiaryList from './components/DiaryList';
import BuyMeACoffee from './components/BuyMeACoffee';
import SideNote from './components/SideNote';
import MobileMenu from './components/MobileMenu';

function App() {
  const [refreshList, setRefreshList] = useState(0);
  const [showEditor, setShowEditor] = useState(false);
  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center py-8">
      <header className="mb-8 w-full max-w-xl mx-auto">
        <h1 className="text-3xl font-bold text-center text-blue-700 mb-2">DiaryMe</h1>
        <p className="text-center text-gray-500">Your private, simple diary app</p>
      </header>
      <main className="w-full max-w-xl mx-auto flex flex-col gap-6">
        <section className="bg-white rounded-xl shadow p-4 flex flex-col items-center">
          <div className="w-full mb-4 text-center">
            <div className="flex flex-col items-center gap-2">
              <span className="text-4xl">ðŸ“”</span>
              <h2 className="text-xl font-bold text-blue-700">Welcome to DiaryMe!</h2>
              <p className="text-gray-600 text-sm">Your private, local diary. No account needed. <br className="hidden sm:block"/>Everything stays on your device.</p>
              <ul className="text-gray-500 text-xs mt-2 space-y-1 text-left mx-auto max-w-xs">
                <li>â€¢ <span className="font-semibold">Create</span> a new entry with <span className="text-blue-600 font-bold">mood</span>, <span className="text-blue-600 font-bold">tags</span>, and <span className="text-blue-600 font-bold">images</span>.</li>
                <li>â€¢ <span className="font-semibold">Edit</span> or <span className="font-semibold">delete</span> entries anytime.</li>
                <li>â€¢ <span className="font-semibold">Export</span> your diary as Word, PDF, or EPUB.</li>
                <li>â€¢ <span className="font-semibold">100% private</span> â€“ your data never leaves your device.</li>
              </ul>
            </div>
          </div>
          {!showEditor && (
            <button
              className="mb-2 bg-blue-600 text-white px-6 py-2 rounded-full font-bold shadow hover:bg-blue-700 transition-all duration-200 text-lg"
              onClick={() => setShowEditor(true)}
            >
              + Create New Entry
            </button>
          )}
          {showEditor && (
            <div className="relative w-full">
              <button
                className="absolute top-2 right-2 bg-red-500 text-white rounded-full px-3 py-1 text-xs font-bold shadow hover:bg-red-600 z-10"
                onClick={() => setShowEditor(false)}
                aria-label="Close editor"
              >
                Ã—
              </button>
              <DiaryEditor
                onSave={() => {
                  setRefreshList(r => r + 1);
                  setShowEditor(false);
                }}
              />
            </div>
          )}
        </section>
        <section className="bg-white rounded-xl shadow p-4">
          <DiaryList refresh={refreshList} />
        </section>
      </main>
      <div className="fixed bottom-4 left-4 flex gap-2">
        <BuyMeACoffee />
        <SideNote />
      </div>
    </div>
  );
}

export default App;
